        function loadFileData(filename) {
        if (gk_isXlsx && gk_xlsxFileLookup[filename]) {

                var workbook = XLSX.read(gk_fileData[filename], { type: 'base64' });
                var firstSheetName = workbook.SheetNames[0];
                var worksheet = workbook.Sheets[firstSheetName];

                // Convert sheet to JSON to filter blank rows
                var jsonData = XLSX.utils.sheet_to_json(worksheet, { header: 1, blankrows: false, defval: '' });
                // Filter out blank rows (rows where all cells are empty, null, or undefined)
                var filteredData = jsonData.filter(row => row.some(filledCell));

                // Heuristic to find the header row by ignoring rows with fewer filled cells than the next row
                var headerRowIndex = filteredData.findIndex((row, index) =>
                  row.filter(filledCell).length >= filteredData[index + 1]?.filter(filledCell).length
                );
                // Fallback
                if (headerRowIndex === -1 || headerRowIndex > 25) {
                  headerRowIndex = 0;
                }

                // Convert filtered JSON back to CSV
                var csv = XLSX.utils.aoa_to_sheet(filteredData.slice(headerRowIndex)); // Create a new sheet from filtered array of arrays
                csv = XLSX.utils.sheet_to_csv(csv, { header: 1 });
                return csv;

                console.error(e);
                return "";

<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Robotics Data Analysis Report</title>
    <!-- Including necessary libraries for React, Recharts, and Tailwind CSS -->
    <script src="https://cdnjs.cloudflare.com/ajax/libs/prop-types/15.8.1/prop-types.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react/18.2.0/umd/react.production.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react-dom/18.2.0/umd/react-dom.production.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/babel-standalone/7.23.2/babel.min.js"></script>
    <script src="https://unpkg.com/papaparse@latest/papaparse.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/chrono-node/1.3.11/chrono.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/recharts/2.15.0/Recharts.min.js"></script>
    <script src="https://cdn.tailwindcss.com"></script>
</head>
<body class="bg-gray-100 font-sans">
    <div id="root" class="container mx-auto p-4"></div>

    <script type="text/babel">
        // Defining main App component
        const App = () => {
            const [data, setData] = React.useState(null);
            const [loading, setLoading] = React.useState(true);

            // Loading and processing CSV data
            React.useEffect(() => {
                Papa.parse(loadFileData("robotics.csv"), {
                    header: true,
                    skipEmptyLines: true,
                    dynamicTyping: false,
                    transformHeader: (header) => header.trim().replace(/^"|"$/g, ''),
                    transform: (value, header) => {
                        let cleaned = value.trim().replace(/^"|"$/g, '');
                        if (['Frame', 'TopLeftCornerX', 'TopLeftCornerY', 'Length', 'Height'].includes(header)) {
                            return cleaned === '' || isNaN(cleaned) ? null : parseFloat(cleaned);
                        }
                        return cleaned;
                    },
                    complete: (results) => {
                        const cleanedData = results.data.filter(row => 
                            row["Frame"] != null && 
                            row["TopLeftCornerX"] != null && 
                            row["TopLeftCornerY"] != null && 
                            row["Length"] != null && 
                            row["Height"] != null
                        );
                        setData(cleanedData);
                        setLoading(false);
                    },
                    error: (err) => {
                        console.error('Error loading CSV:', err);
                        setLoading(false);
                    }
                });
            }, []);

            // Rendering loading message while data is being fetched
            if (loading) {
                return (
                    <div className="flex justify-center items-center h-screen">
                        <p className="text-xl text-gray-600">Loading...</p>
                    </div>
                );
            }

            // Aggregating data by Frame for performance optimization
            const aggregatedData = data.reduce((acc, row) => {
                const frame = row["Frame"];
                if (!acc[frame]) {
                    acc[frame] = [];
                }
                acc[frame].push(row);
                return acc;
            }, {});

            const frameCounts = Object.keys(aggregatedData).map(frame => ({
                frame: parseFloat(frame),
                count: aggregatedData[frame].length
            }));

            // Calculating average dimensions per frame
            const avgDimensions = Object.keys(aggregatedData).map(frame => {
                const rows = aggregatedData[frame];
                const avgLength = rows.reduce((sum, row) => sum + row["Length"], 0) / rows.length;
                const avgHeight = rows.reduce((sum, row) => sum + row["Height"], 0) / rows.length;
                return { frame: parseFloat(frame), avgLength, avgHeight };
            });

            // Calculating bounding box area
            const areaData = data.map(row => ({
                frame: row["Frame"],
                area: row["Length"] * row["Height"]
            }));

            // Finding notable observation: frame with largest bounding box area
            const maxArea = areaData.reduce((max, curr) => 
                curr.area > max.area ? curr : max, 
                { frame: 0, area: 0 }
            );

            // Rendering the report
            return (
                <div className="bg-white p-8 rounded-lg shadow-lg">
                    <h1 className="text-3xl font-bold mb-4 text-center text-blue-600">
                        Robotics Data Analysis Report
                    </h1>

                    {/* Summary Section */}
                    <section className="mb-8">
                        <h2 className="text-2xl font-semibold mb-2 text-gray-800">Summary</h2>
                        <p className="text-gray-600">
                            This report analyzes a dataset containing bounding box data from a robotics application, 
                            including frame numbers, top-left corner coordinates (X, Y), and dimensions (Length, Height). 
                            The dataset comprises 18,867 records, with no missing values. The analysis focuses on 
                            understanding the distribution of bounding boxes, their spatial positions, and relationships 
                            between dimensions across frames. Visualizations include scatter plots, line charts, and a 
                            correlation matrix to highlight key patterns and insights.
                        </p>
                    </section>

                    {/* Notable Observation */}
                    <section className="mb-8">
                        <h2 className="text-2xl font-semibold mb-2 text-gray-800">Notable Observation</h2>
                        <p className="text-gray-600">
                            The largest bounding box area observed is {maxArea.area.toFixed(2)} square units in Frame {maxArea.frame}. 
                            This unusually large area suggests a significant object or anomaly detected in that frame, potentially 
                            indicating a critical event or a large object in the robotics application.
                        </p>
                    </section>

                    {/* Visualization: Bounding Boxes per Frame */}
                    <section className="mb-8">
                        <h2 className="text-2xl font-semibold mb-2 text-gray-800">Bounding Boxes per Frame</h2>
                        <p className="text-gray-600 mb-4">
                            This line chart shows the number of bounding boxes detected per frame, highlighting the density 
                            of object detections over time.
                        </p>
                        <Recharts.ResponsiveContainer width="100%" height={400}>
                            <Recharts.LineChart data={frameCounts}>
                                <Recharts.CartesianGrid strokeDasharray="3 3" />
                                <Recharts.XAxis dataKey="frame" label={{ value: 'Frame', position: 'insideBottom', offset: -5, fontSize: 12 }} />
                                <Recharts.YAxis label={{ value: 'Number of Bounding Boxes', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                                <Recharts.Tooltip />
                                <Recharts.Legend />
                                <Recharts.Line type="monotone" dataKey="count" stroke="#3B82F6" name="Bounding Boxes" />
                            </Recharts.LineChart>
                        </Recharts.ResponsiveContainer>
                    </section>

                    {/* Visualization: Length vs Height Scatter Plot */}
                    <section className="mb-8">
                        <h2 className="text-2xl font-semibold mb-2 text-gray-800">Length vs Height</h2>
                        <p className="text-gray-600 mb-4">
                            This scatter plot visualizes the relationship between the length and height of bounding boxes, 
                            revealing patterns in object dimensions.
                        </p>
                        <Recharts.ResponsiveContainer width="100%" height={400}>
                            <Recharts.ScatterChart>
                                <Recharts.CartesianGrid strokeDasharray="3 3" />
                                <Recharts.XAxis dataKey="Length" label={{ value: 'Length', position: 'insideBottom', offset: -5, fontSize: 12 }} />
                                <Recharts.YAxis dataKey="Height" label={{ value: 'Height', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                                <Recharts.Tooltip />
                                <Recharts.Scatter name="Bounding Boxes" data={data} fill="#3B82F6" />
                            </Recharts.ScatterChart>
                        </Recharts.ResponsiveContainer>
                    </section>

                    {/* Visualization: Top Left Corner Positions */}
                    <section className="mb-8">
                        <h2 className="text-2xl font-semibold mb-2 text-gray-800">Top Left Corner Positions</h2>
                        <p className="text-gray-600 mb-4">
                            This scatter plot displays the spatial distribution of bounding box top-left corners, colored by frame, 
                            to show how objects are positioned across the frames.
                        </p>
                        <Recharts.ResponsiveContainer width="100%" height={400}>
                            <Recharts.ScatterChart>
                                <Recharts.CartesianGrid strokeDasharray="3 3" />
                                <Recharts.XAxis dataKey="TopLeftCornerX" label={{ value: 'Top Left Corner X', position: 'insideBottom', offset: -5, fontSize: 12 }} />
                                <Recharts.YAxis dataKey="TopLeftCornerY" label={{ value: 'Top Left Corner Y', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                                <Recharts.Tooltip />
                                <Recharts.Scatter name="Positions" data={data} fill="#EF4444" />
                            </Recharts.ScatterChart>
                        </Recharts.ResponsiveContainer>
                    </section>

                    {/* Visualization: Average Dimensions Over Frames */}
                    <section className="mb-8">
                        <h2 className="text-2xl font-semibold mb-2 text-gray-800">Average Dimensions Over Frames</h2>
                        <p className="text-gray-600 mb-4">
                            This line chart illustrates the average length and height of bounding boxes per frame, showing trends 
                            in object sizes over time.
                        </p>
                        <Recharts.ResponsiveContainer width="100%" height={400}>
                            <Recharts.LineChart data={avgDimensions}>
                                <Recharts.CartesianGrid strokeDasharray="3 3" />
                                <Recharts.XAxis dataKey="frame" label={{ value: 'Frame', position: 'insideBottom', offset: -5, fontSize: 12 }} />
                                <Recharts.YAxis label={{ value: 'Dimension', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                                <Recharts.Tooltip />
                                <Recharts.Legend />
                                <Recharts.Line type="monotone" dataKey="avgLength" stroke="#3B82F6" name="Average Length" />
                                <Recharts.Line type="monotone" dataKey="avgHeight" stroke="#EF4444" name="Average Height" />
                            </Recharts.LineChart>
                        </Recharts.ResponsiveContainer>
                    </section>

                    {/* Conclusion */}
                    <section>
                        <h2 className="text-2xl font-semibold mb-2 text-gray-800">Conclusion</h2>
                        <p className="text-gray-600">
                            The analysis reveals that the robotics dataset contains a diverse set of bounding boxes with varying 
                            dimensions and positions. The scatter plots and line charts indicate no strong linear relationship 
                            between length and height, suggesting varied object sizes. The spatial distribution of top-left corner 
                            positions shows clustering in certain areas, possibly indicating regions of interest in the robotics 
                            application. The frame-wise analysis highlights fluctuations in the number and size of bounding boxes, 
                            with Frame {maxArea.frame} standing out due to its exceptionally large bounding box area. These insights 
                            can guide further investigation into specific frames or regions for robotics applications, such as object 
                            detection or tracking.
                        </p>
                    </section>
                </div>
            );
        };

        // Rendering the App component using createRoot
        const root = ReactDOM.createRoot(document.getElementById('root'));
        root.render(<App />);
    </script>
</body>
